import React, { useState } from 'react';
import Title from './UI/Title/Title';
import Button, { ButtonBorderVariant, ButtonTextVariant } from './UI/Button/Button';
import isHover from '../classes/isHover';


const UsefulButtons = () => {
    return (
        <div className='UsefulButtons'>
            <Title hType='h1'>полезные кнопки</Title>
            <div className="UsefulButtons__buttons"
            >
                <div
                className="button1wrapper"
                onMouseOver={isHover.mouseOverHandler}
                onMouseOut={isHover.mouseOutHandler}
                >
                <Button

                    text="узнать больше"
                    variantBorder={isHover.isHoverState ? ButtonBorderVariant.dirty : ButtonBorderVariant.black}
                    variantText={isHover.isHoverState ? ButtonTextVariant.dirty : ButtonTextVariant.black}
                    height={55}
                    width={207}
                />


                </div>

            </div>
        </div>
    );
};

export default UsefulButtons;
